from typing import List
class Solution:
    def getHashedValue(self, s, hash = None, previous = None, new = None):
        hash_value = 0
        count = 9
        if hash == None:
            for ch in s:
                hash_value += (ord(ch)-ord('A')+1)* (4**count)
                count -= 1
        else:
            hash = hash - ((ord(previous)-ord('A')+1)*(4**9))
            hash *= 4
            hash = hash +  (ord(new)-ord('A')+1)
            hash_value = hash
        return hash_value

    def findRepeatedDnaSequences(self, s: str) -> List[str]:
        result = set()
        length = len(s)
        my_set = set()
        if length < 10:
            return []
        
        hash = self.getHashedValue(s[0: 10])
        my_set.add(s[0:10])

        for i in range(1, length-9):
            if i + 9 < length:
                previous = s[i-1]
                new = s[i + 9]
                hash = self.getHashedValue(s[i: i+10], hash, previous, new)
                if not s[i: i+10] in my_set:
                    my_set.add(s[i: i+10])
                else:
                    result.add(s[i: i+10])
        return list(result)

ob = Solution()

s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"
print(ob.findRepeatedDnaSequences(s))
s = "AAAAAAAAAAAAA"
print(ob.findRepeatedDnaSequences(s))
